import React, {Component} from "react";

class ShortStoryDetail extends Component {
    render() {
        return (
            <React.Fragment>
                <h5 className="text-center">Cinderellla</h5>
                <hr/>

                <div>
                    <img
                        className="mx-auto"
                        src="/images/ShortStory/cinderella.jpg"
                        alt="Cinderella"/>
                </div>
            </React.Fragment>
        );
    }
}

export default ShortStoryDetail;
